package gxa.db;

public class BarAndPie {
	private String item;
	private int no;

	public BarAndPie() {
		super();
		// TODO Auto-generated constructor stub
	}

	public BarAndPie(String item, int no) {
		super();
		this.item = item;
		this.no = no;
	}

	public String getItem() {
		return item;
	}

	public void setItem(String item) {
		this.item = item;
	}

	public int getNo() {
		return no;
	}

	public void setNo(int no) {
		this.no = no;
	}

}
